import React, {Component} from 'react';
import MenuItem from '@material-ui/core/MenuItem';
import InputLabel from '@material-ui/core/MenuItem';
import Select from '@material-ui/core/Select';
import SelectControl from 'components/select-control'


const seatsNumberList = [
  { value: 1, label: 'Table for 1'},
  { value: 2, label: 'Table for 2'},
  { value: 3, label: 'Table for 3'},
  { value: 4, label: 'Table for 4'},
  { value: 5, label: 'Table for 5'},
  { value: 6, label: 'Table for 6'},
  { value: 7, label: 'Table for 7'},
]

export default class SeatsPicker extends React.Component {
  state = {
    open: false,
    seats: ''
  };

  handleChange = event => {
    this.setState({ [event.target.name]: event.target.value });
  };


render() {

  return (
    <div>
        <SelectControl />
    </div>
  );
 }
};
